// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Graph Grid</h1>
      </header>
      <div className="graph-grid">
        {[...Array(64)].map((_, index) => (
          <div key={index} className="grid-cell"></div>
        ))}
        <div className="red-square"></div>
      </div>
    </div>
  );
}

export default App;
